import React, { useState } from 'react'
import {ButtonGroup,Button} from '@material-ui/core'

export default function App() {

  return (
    <div>
               <ButtonGroup color='primary' variant='outlined'>


              <Button>One</Button>  
              <Button>Two</Button>  
              <Button>Three</Button>  


              </ButtonGroup>
    </div>
  )
}
